CREATE TABLE IF NOT EXISTS `contact_type_outcome` (
  `date_modified` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `date_created` timestamp NOT NULL default '0000-00-00 00:00:00',
  `active_status` enum('active','inactive') NOT NULL default 'active',
  `contact_type_id` int(10) unsigned NOT NULL default '0',
  `contact_outcome_id` int(10) unsigned NOT NULL default '0',
  `contact_interval` smallint(6) default NULL,
  PRIMARY KEY  (`contact_type_id`,`contact_outcome_id`)
);
